import React from 'react';
import { useTheme } from '@material-ui/core/styles';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from './Title';
import Drawer from '@material-ui/core/Drawer';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  toolbar: {
    paddingRight: 24, // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: '0 8px',
	paddingLeft: '71px',
    ...theme.mixins.toolbar,
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 36,
  },
  menuButtonHidden: {
    display: 'none',
  },
  title: {
    flexGrow: 1,
  },
  drawerPaper: {

    width: drawerWidth,

  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: '100vh',
    overflow: 'auto',
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
  },
  paper: {
    padding: theme.spacing(2),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
  },
  fixedHeight: {
    height: 240,
  },
}));

export default function Landing() {
  const theme = useTheme();

  return (

    <div>

	<Drawer

        variant="permanent"

        anchor="right"
      >

        <div>
   <ListItem button>

      <ListItemText primary="Getting Started" />
    </ListItem>
    <ListItem button>

      <ListItemText primary="New Project" />
    </ListItem>
    <ListItem button>

      <ListItemText primary="Import STIX 2.0" />
    </ListItem>
    <ListItem button>

      <ListItemText primary="Export STIX 2.0" />
    </ListItem>
    </div>

      </Drawer>

		 <Typography component="h1" variant="h2" color="inherit" gutterBottom noWrap>
            Getting Started
         </Typography>

		  <Typography component="subtitle1" color="inherit">
            EASIX offers a lightweight solution for constucting
			and exporting STIX 2.1 visualisations, for use with
			exchanging cyber threat intelligence (CTI). EASIX 
			is an open source tool and those interested	can 
			contribute and ask questions freely.
         </Typography>

    </div>

  );
}
